import React, { useState } from "react";
import SweetAlert from "sweetalert2";

const Register = () => {
  const [formData, setFormData] = useState({
    username: "",
    password: "",
    identificacion: "",
    ubicacion: "",
    primerNombre: "",
    segundoNombre: "",
    primerApellido: "",
    segundoApellido: "",
    email: "",
    fechaNacimiento: "",
    // Agrega otros campos segÃºn sea necesario
  });

  const [modalMessage, setModalMessage] = useState("");
  const [modalType, setModalType] = useState("");
  const [showModal, setShowModal] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch("http://localhost:9001/Laboratorio1/persona", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      });

      if (response.status === 409) {
        setModalMessage("El usuario ya existe. Por favor, elige otro username o identificacion.");
        setModalType("error");
        setShowModal(true);
        return; 
      }

      let responseData;
      const contentType = response.headers.get("content-type");
      if (contentType && contentType.includes("application/json")) {
        responseData = await response.json();
      } else {
        responseData = await response.text();
      }

      if (response.ok) {
        setModalMessage(typeof responseData === "object" ? responseData.message : responseData);
        setModalType("success");
        setShowModal(true);
      } else {
        setModalMessage(typeof responseData === "object" ? responseData.message : responseData);
        setModalType("error");
        setShowModal(true);
      }
    } catch (error) {
      console.error("Error:", error);
      setModalMessage("Error en la solicitud.");
      setModalType("error");
      setShowModal(true);
    }
  };

  return (
    <div className="container">
      <h2>Registro</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="username">Username:</label>
          <input
            type="text"
            name="username"
            className="form-control"
            value={formData.username}
            onChange={handleChange}
            required
            autoComplete="username" // Agregado
          />
        </div>

        <div className="form-group">
          <label htmlFor="password">Password:</label>
          <input
            type="password"
            name="password"
            className="form-control"
            value={formData.password}
            onChange={handleChange}
            required
            autoComplete="current-password" // Agregado
          />
        </div>

        <div className="form-group">
          <label htmlFor="identificacion">IdentificaciÃ³n:</label>
          <input
            type="text"
            name="identificacion"
            className="form-control"
            value={formData.identificacion}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="ubicacion">UbicaciÃ³n:</label>
          <input
            type="text"
            name="ubicacion"
            className="form-control"
            value={formData.ubicacion}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="primerNombre">Primer Nombre:</label>
          <input
            type="text"
            name="primerNombre"
            className="form-control"
            value={formData.primerNombre}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="segundoNombre">Segundo Nombre:</label>
          <input
            type="text"
            name="segundoNombre"
            className="form-control"
            value={formData.segundoNombre}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="primerApellido">Primer Apellido:</label>
          <input
            type="text"
            name="primerApellido"
            className="form-control"
            value={formData.primerApellido}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="segundoApellido">Segundo Apellido:</label>
          <input
            type="text"
            name="segundoApellido"
            className="form-control"
            value={formData.segundoApellido}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="email">Email:</label>
          <input
            type="email"
            name="email"
            className="form-control"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="fechaNacimiento">Fecha de Nacimiento:</label>
          <input
            type="date"
            name="fechaNacimiento"
            className="form-control"
            value={formData.fechaNacimiento}
            onChange={handleChange}
            required
          />
        </div>

        <button type="submit" className="btn btn-primary">Registrar</button>
      </form>

      {showModal && (
        <SweetAlert
          title={modalType === "error" ? "Error" : "Ãxito"}
          text={modalMessage}
          type={modalType}
          onConfirm={() => setShowModal(false)}
        />
      )}
    </div>
  );
};

export default Register;
